    {
      id: 6,
      name: "ورد صناعي",
      state: "نشط",
    },
  ];

  const addCategory = () => {
    getShowAdd(true);
  };
  return (
    <CustomComp
      title="التصنيفات"
      paragraphe="عدد التصنيفات 37 طلب"
      add="اضافة تصنيف"
      table={TableCategorie}
      items={itemsCategorie}
      boxx={false}
      navigate={false}
      onClick={addCategory}
      addCategory={showAdd}
    />
  );
};

export default Categories;
